import { Table } from "antd";
import alerts from "./Data/alert.json";

function ThreatsTable() {
  return (
    <div>
      <h3 style={{ color: "white" }}>Detected Cyber Security Threats</h3>
      <Table
        dataSource={alerts}
        columns={columns}
        pagination={{
          defaultPageSize: 10,
        }}
      />
    </div>
  );
}

const dataSource = [];

const columns = [
  {
    title: "Timestamp",
    dataIndex: "timestamp",
    key: "timestamp",
  },
  {
    title: "Source",
    dataIndex: "source",
    key: "source",
  },
  {
    title: "Destination",
    dataIndex: "destination",
    key: "destination",
  },
  {
    title: "Threat Info",
    dataIndex: "threatinfo",
    render: (text, record) => (
      <span>
        <b>Threat Category</b>
        {record.threat_category} <b>Threat Name</b>
        {record.threat_name}
      </span>
    ),
  },
  // {
  //   title: "Threat Type",
  //   dataIndex: "threat",
  //   key: "threat",
  //   filters: [
  //     {
  //       text: "Trojan",
  //       value: "Trojan",
  //     },
  //     {
  //       text: "Rootkit",
  //       value: "Rootkit",
  //     },
  //   ],
  //   onFilter: (value, record) => record.threat.includes(value),
  //   filterMode: "tree",
  //   filterSearch: true,
  // },
];

export default ThreatsTable;
